"違います！","プレイヤーの手番","ファイルを選択","分析力・変化図の容量によって4種類のプランがあります:\n| プラン | 探索回数 | 変化図 | サンプル | 月額料金 |\n| :------------ | ------------: | :------------ | :-----------: | :-----------: |\n| Free | 50 | 約 4 手 | [Link](https://ai-sensei.com/game/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-MEOHXb-aWU8XYdK2crS) | **無料** |\n| Basic | 500 | 約 10 手 | [Link](https://ai-sensei.com/game/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-MEOH_QbtwiqJ0RcAf28) | 695円 |\n| Dan | 2500 | 約 15 手 | [Link](https://ai-sensei.com/game/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-MEOHcgRXzZZ4nYCsUTr) | 1395 円 |\n| Pro | 10000 | 約 18 手 | [Link](https://ai-sensei.com/game/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-MEOHeLyW7TRfrXn513c) | 3295 円 |\n\x3cbr\x3e \n**Freeプラン**\x3cbr\x3e 　使用頻度の少ない方や囲碁AIを無料で試してみたいという方にお勧めです\x3cbr\x3e 　50回の探索ですでにAIの強さはプロ棋士と同程度ですが、死活に関しては読み違える事も時々起こります\x3cbr\x3e　AIの変化図は、約4手の長さです\x3cbr\x3e \n**Basicプラン**\x3cbr\x3e 　少額で高品質な検討を利用できます\x3cbr\x3e 　探索回数500でAIはスーパーパワーを発揮し、ポジションによっては10手程度の変化図を出力します\x3cbr\x3e **Danプラン**\x3cbr\x3e　意欲的に研究したい方に向けて、パワフルな分析を提供します\x3cbr\x3e　1手あたり2500の探索回数により、非常に正確で深い読みが可能です\n\x3cbr\x3e　変化図は平均して15手程度、時にはそれ以上になることもあります\x3cbr\x3e **Proプラン**\x3cbr\x3e 　最も集中的に学べるプランです\n10000の探索回数で、平均して約18手の変化図を得ることができます\x3cbr\x3e\x3cbr\x3e ＊上記のサンプルにある対局は、全てのプラン（レベル）で分析したものになります\nそれぞれレベルの違いを比較してみてください\x3cbr\x3e＊どれにしようかな？と迷ったら、まず**Basicプラン**から始めてみましょう\x3cbr\x3e 　すでに十分といえるプランですが、それ以上必要と思ったらいつでもプランの変更が可能です\x3cbr\x3e ＊「Free」を選択し直すとプランはいつでも解約できます。またプランは期間終了まで維持することができます",
